INSERT INTO `pm_videos` VALUES ('282', 'bb9801b82', 'فيلم العودة للوطن مدبلج HD', '<h4 style=\"text-align: center;\">تدور أحداث فيلم العودة للوطن Eve D&ouml;n&uuml;ş&nbsp;:&nbsp;على الطريق الرئيسي المؤدي إلى<span id=\"more-2426\"></span>&nbsp;ضواحي كارس شرق الأناضول في شتاء عام 1915، عقب انتهاء معركة ساريكاميس، حيث لم يكن أحد يملك تلك الأرض عندما انتهت الحرب، واستمر الصراع بين سبعة أشخاص مختلفين.<br />عبر حوار غير اعتيادي ، و صور لا يمكن نسيانها ، يأخذنا الفيلم نحو حياة سبعة أشخاص يختلفون في نمط حياتهم، لمحاولة تجنب الحرب وإيجاد طريق آمن للعودة .<br />يلتقي السبعة في قرية أرمينية مهجورة ليواجهوا سويا فصل &nbsp;شتاء قارس، حيث سيكابدون مشقة إيجاد الطعام .<br />ومع مرور الأيام يزداد الوضع سوءاً، فتتصاعد الصراعات فيما بينهم، وفي هذا الطريق الموحش يفقدون ما لا يمكن استعادته حتى وإن عادوا للوطن الذي خرجوا في الطريق إليه.</h4>
