INSERT INTO `pm_videos` VALUES ('284', 'df930c6a0', 'فيلم لعنة الماضي مدبلج اون لاين', '<h4 style=\"text-align: center;\"><strong>في طريق سلكه ضابط الشرطة السرّي عادل بخطوات ثابتة نحو مصير أكثر ظلمة مما كانت عليه طفولته، يخسر أكثر مما حاول أن يكسبه، في ذلك الطريق الذي يُدعى الانتقام</strong><br /><strong>لعنة الماضي تلاحق عادل، ذلك الطفل الذي شهد مقتل والديه أمام عينيه، فسعى بعد أعوام طويلة لأن ينتقم من القاتل، وفي الوقت الذي ظن أنه كسب المعركة، يفاجئ بالمزيد من الخسائر تلاحقه.</strong><br /><strong>لعنة الماضي، فيلم تركي، ينتمي إلى فئة دراما الأكشن البوليسية، انتاج وإخراج وقصة المخرج التركي الشهير عثمان سيناف، كما اشترك السينارست أيبارس بورا كاهيا أوغلو في كتابة السيناريو.</strong><br /><strong>الفيلم بطولة النجم الألماني التركي الشهير محمد كورتولوش، والممثلة الصاعدة نداء شفق، والنجم القدير سلجوق يونتم، والنجم أوغور بولاط، والنجم خلوق بييس، والممثل القدير مراد دالتابان،</strong></h4>', 'df930c6a0', '0', 'df930c6a0-1.jpg', '0', '37', '1', 'admin', '1469271865', '1468924635', '2', '', '0', '1', '0', '0', '0', '0', '0', '1', '1', '%d9%81%d9%8a%d9%84%d9%85-%d9%84%d8%b9%d9%86%d8%a9-%d8%a7%d9%84%d9%85%d8%a7%d8%b6%d9%8a-%d9%85%d8%af%d8%a8%d9%84%d8%ac-%d8%a7%d9%88%d9%86-%d9%84%d8%a7%d9%8a%d9%86');
