INSERT INTO `pm_videos` VALUES ('285', 'dd9842919', 'فيلم قلب واحد', '<p style=\"text-align: center;\"><strong>في زمن الحرب قصة حب ووفاء بين زوجة تفعل المستحيل للحفاظ على حبها وزواجها رغم الإعتقالات والسجون</strong>&nbsp;أ<strong>حد أفضل الإنتاجات السينمائية التركية فيلم \"قلب واحد\" هو أكثر الأعمال التي تم رصد لها ميزانية إنتاجية في تاريخ السينما التركيةالفيلم يتناول بصورة واسعة قصة شابين\" نياز\" و\"جنت\" تسببت الحروب في انفصالهما وابتعادهما عن بعضهما البعض،إلا أن القدر يجمعهما مرة أخرى في القطار الذي ينقل عدداً كبيراً من الناس إلى معسكر الأعمال، ولم تكتمل فرحتهما بالبقاء معا، وحاولا الهروب من القطار .&nbsp;تسببت الحروب في انفصالهما وابتعادهما عن بعضهما البعض، إلا أن القدر يجمعهما مرة أخرى في القطار الذي ينقل عدداً كبيراً من الناس إلى معسكر الأعمال،&nbsp;ولم تكتمل فرحتهما بالبقاء معا، وحاولا الهروب من القطار .أحداث الفيلم تنقسم إلى مسارين&nbsp; المسار الأول أسرة المعلم يونس وزوجته ديليك ياغمور كاشف أوغلوبينما يركز المسار الثاني على أسرة نياز سيركان شينالب وزوجته جنة هانده سورال وما آل إليه مصيرها المفجعبعد أن كحلت عينيها برؤية حبيبها وزوجها الذي انتظرته خمسين عامًا وظلت وفية إليه، ومخلصة لحبه&nbsp;</strong></p>', 'dd9842919', '5902', 'dd9842919-1.jpg', '0', '37', '1', 'admin', '1469271868', '1468924791', '5', '', '0', '1', '0', '0', '0', '0', '0', '1', '1', '%d9%81%d9%8a%d9%84%d9%85-%d9%82%d9%84%d8%a8-%d9%88%d8%a7%d8%ad%d8%af');
