INSERT INTO `pm_videos` VALUES ('125', '2b52e5708', 'مسرحية مدرسه المشاغبين - masrhiat madrest el moshaghaben', '<p>مدرسة المشاغبين هي مسرحية كوميدية عرضت في 24 أكتوبر 1973 بعد حرب 73 بأيام قليلة. من بطولة الفنانين المصريين: سعيد صالح، عادل إمام، يونس شلبي، أحمد زكي، حسن مصطفى، سهير البابلي وهادي الجيار. ألف المسرحية الكاتب المصري علي سالم.<br /> تتلخص أحداث المسرحية في خمسة من الطلبة المشاغبين، يجمعهم فصل واحد داخل مدرسة لا يستطيع مديرها السيطرة على شغبهم، حيث يظهرون تفوقهم عليه في عدة مواقف، فيبعث مدير المنطقة بامرأة معلمة كي تهذب الأولاد، فيعبث معها الأشقياء أول الأمر، لكنها لا تكل، وتحاول جاهدة تهذيب الأولاد، وتستطيع في النهاية أن تسيطر على مجرى الأمور وعلى الأولاد.<br /> تمتلئ المسرحية بالمواقف الكوميدية الساخرة، وذلك الأمر كان سبياً في شهرتها وأيضا في صعود نجومها إلى أعالي المسرح والسينما المصرية لاحقا.</p>', 'ZgnNw6DOGPQ', '13221', '//i.ytimg.com/vi/ZgnNw6DOGPQ/mqdefault.jpg', '0', '30', '1', 'admin', '1468707367', '1468690749', '3', 'https://www.youtube.com/watch?v=ZgnNw6DOGPQ', '3', '1', '0', '1469409905', '1', '0', '0', '1', '1', '%d9%85%d8%b3%d8%b1%d8%ad%d9%8a%d8%a9-%d9%85%d8%af%d8%b1%d8%b3%d9%87-%d8%a7%d9%84%d9%85%d8%b4%d8%a7%d8%ba%d8%a8%d9%8a%d9%86-masrhiat-madrest-el-moshaghaben');
INSERT INTO `pm_videos` VALUES ('126', '201073cc4', 'مسرحية هاله حبيبتى', '<h4 style=\"text-align: center;\">(هالة) هي طفلة يتيمة، يستضيفها ملياردير في قصره، لتنجو من ملجأ الأيتام الذي تعاني فيه هي وسائر الأطفال من ظلم المُشرِفة، لكن الطفلة بشخصيتها العنيدة المرحة وروحها الفكاهية مع ذكاءها الكبير، تُصِر إصرارًا شديدًا على اصطحاب كلبها ليُقيم معها في القصر رغم معارضة الملياردير ذلك.. ومن ثَم تنجح هالة في ملء فراغ حياة الملياردير وفرض إرادتها عليه ببراءتها الآسرة، بل وتنجح بنهاية المطاف في توجيه قلبه لسكرتيرته التي تحبه حتى يبادلها ذلك الحُب.</h4>', 'NxjEiiIQkVg', '10975', '//i.ytimg.com/vi/NxjEiiIQkVg/mqdefault.jpg', '0', '30', '1', 'admin', '1468756637', '1468690866', '7', 'https://www.youtube.com/watch?v=NxjEiiIQkVg', '3', '1', '0', '1469409905', '1', '0', '0', '1', '1', '%d9%85%d8%b3%d8%b1%d8%ad%d9%8a%d8%a9-%d9%87%d8%a7%d9%84%d9%87-%d8%ad%d8%a8%d9%8a%d8%a8%d8%aa%d9%89');
INSERT INTO `pm_videos` VALUES ('127', 'e42165ebb', 'مسرحية سك  عل بناتك - masrhiat sook ala banatk', '<p>سك على بناتك مسرحية مصرية كوميدية إنتاج 1980 بطولة فؤاد المهندس، شويكار، أحمد راتب،سناء يونس، شريهان, إجلال زكي.<br /> رجل ارمل يحاول أن يزوج بناته بسرعة ليلحق بقطار الزواج من حبيبته عصمت (شويكار) وأثناء ذلك يواجه مشكلات كلا من بناته في اطار كوميدي</p>', '_qnwwAw0n9I', '13449', '//i.ytimg.com/vi/_qnwwAw0n9I/mqdefault.jpg', '0', '30', '1', 'admin', '0', '1468690948', '1', 'https://www.youtube.com/watch?v=_qnwwAw0n9I', '3', '1', '0', '1469413506', '1', '0', '0', '1', '1', '%d9%85%d8%b3%d8%b1%d8%ad%d9%8a%d8%a9-%d8%b3%d9%83-%d8%b9%d9%84-%d8%a8%d9%86%d8%a7%d8%aa%d9%83-masrhiat-sook-ala-banatk');
INSERT INTO `pm_videos` VALUES ('128', '622d35823', 'مسرحية المتزوجون - masrahiat el motzawgon', '<p>متزوجون، مسرحية مصرية من تأليف فيصل ندا وبطولة سمير غانم وجورج سيدهم وشيرين وآخرون.<br /> تناقش مشكلة المتزوجون في مصر بشكل كوميدي والمشاكل الاقتصادية التي تواجههم والفوارق بين الطبقات، أداء متميز لكل من سمير غانم وجورج سيدهم.<br /> تدور أحداث القصة حول مشاكل المتزوجين في (مصر) من الجوانب الاقتصادية والاجتماعية، حيث يقع الشاب الفقير (مسعود) في حب الفتاة الأرستقراطية (لينا)، ويتزوجها بالرغم من رفض والدها، تتنقل (لينا) إلى بيت (مسعود) المتواضع للعيش معه، وخوض تجربة الحياة الفقيرة البسيطة مع زوجها الذي تحبه، يحاول والدها الضغط عليها بشتى الوسائل، ومنها تهديدها بحرمانها من الميراث، لكنها تصمم على البقاء مع زوجها، يطلب (مسعود) من (لينا) الانتقال معها إلى فيلا والدها بهدف الخروج من الحياة الصعبة التي يعيشها في المنزل المستأجر.</p>', 'dBoxjTBKJPI', '10658', '//i.ytimg.com/vi/dBoxjTBKJPI/mqdefault.jpg', '0', '30', '1', 'admin', '0', '1468691000', '1', 'https://www.youtube.com/watch?v=dBoxjTBKJPI', '3', '1', '0', '1469413506', '1', '0', '0', '1', '1', '%d9%85%d8%b3%d8%b1%d8%ad%d9%8a%d8%a9-%d8%a7%d9%84%d9%85%d8%aa%d8%b2%d9%88%d8%ac%d9%88%d9%86-masrahiat-el-motzawgon');
INSERT INTO `pm_videos` VALUES ('129', '8d1c5c357', 'مسرحية  ريا وسكينه - masrhiat raya w skina', '<p>ريا وسكينة هي مسرحية كوميدية مصرية عرضت في عام 1984 من بطولة<br /> شادية<br /> سهير البابلي<br /> عبد المنعم مدبولي<br /> أحمد بدير<br /> وتدور حول أحداث حقيقية حدثت في الإسكندرية في أوائل القرن العشرين عن اختطاف وقتل النساء على يد ريا وشقيقتها سكينة.<br /> هذه المسرحية هي التجربة الأولى والأخيرة في تاريخ المشوار الفنى في حياة شادية على خشبة المسرح.<br /> الإنتاج لسمير خفاجي وفرقة المتحدين.<br /> التأليف لبهجت قمر.<br /> ألحان الأغنيات والموسيقى التصويريه لبليغ حمدي.<br /> كلمات الأغاني للشاعر عبد الوهاب محمد.<br /> تصميم الأزياء لفريدة فهمي.<br /> تصميم الإستعراضات لمحمود رضا.<br /> والإخراج لحسين كمال.</p>', 'zwZ0a2ZwHUA', '11880', '//i.ytimg.com/vi/zwZ0a2ZwHUA/mqdefault.jpg', '0', '30', '1', 'admin', '0', '1468691051', '0', 'https://www.youtube.com/watch?v=zwZ0a2ZwHUA', '3', '1', '0', '1469414705', '1', '0', '0', '1', '1', '%d9%85%d8%b3%d8%b1%d8%ad%d9%8a%d8%a9-%d8%b1%d9%8a%d8%a7-%d9%88%d8%b3%d9%83%d9%8a%d9%86%d9%87-masrhiat-raya-w-skina');
INSERT INTO `pm_videos` VALUES ('130', '87d9cb5df', 'مسرحية  الزعيم - masrhiat el zaem', '<p>بطولة <br /> عادل امام <br /> يوسف داوود <br /> احمد راتب <br /> يوسف داوود <br /> مصطفى متولى <br /> رجاء الجداوى <br /> منال سلامة <br /> تدور أحداثها حول حال أحد الحكام الديكتاتوريين في إحدى الدول العربية، وعن أحد أفراد الشعب الذي يشبه تماما الزعيم ويدعى زينهم.<br /> يأمر الديكتاتور باعتقاله، وقبل تنفيذ ذلك يموت الحاكم، فتقوم الحاشية التي تستفيد من وجود الحاكم بتقديم<br /> زينهم الرجل البسيط الذي لا يستطيع أن يصمد في أي عمل لفترة نتيجة للتشابه الذي بينه وبين زعيم دولته الدكتاتور الغير محبوب, ولكنه يحصل أخيرا على عمل إذ يحاول أحدهم أن يخرج فيلما يحاول فيه أن ينال من الرئيس ويصوره على أنه حرامي فيختار زينهم لهذا الدور أيضا نظرا للتشابه بينه وبين الزعيم، فيجد أخيرا زينهم العمل ككومبارس في السينما، ولست أدري أن اختلف واقع حياته عن عمله، فهو من المهمشين في الحياة الذين لا دور يذكر لهم ووجودهم مثل عدمه. ذلك الرجل الذي أقصى أحلامهم هو أن يحصل على قوت يومه وأن يتخلص من مطاردة فتاة تريد أن تتزوجه... لا أعتقد أن زينهم راوده حلم أو أراد أن يكون له دور في الحياة أبعد من وظيفة مستقرةودخل ثابت. ولكن يأتي اليوم الذي فيه يستيقظ من نومه ليجد نفسه على فراش غير الفراش ومهنة غير المهنة.<br /> ويتحول الكومبارس إلى زعيم لدولته بسبب ذلك التشابه العجيب بين زعيم راحل خاف رجاله من بطش الشعب فوضعوا ذلك الكومبارس ليحل محله وليحكموا البلاد من خلاله.</p>', 'lgeWjZ2KUsE', '12089', '//i.ytimg.com/vi/lgeWjZ2KUsE/mqdefault.jpg', '0', '30', '1', 'admin', '1469099442', '1468691126', '2', 'https://www.youtube.com/watch?v=lgeWjZ2KUsE', '3', '1', '0', '1469409905', '1', '0', '0', '1', '1', '%d9%85%d8%b3%d8%b1%d8%ad%d9%8a%d8%a9-%d8%a7%d9%84%d8%b2%d8%b9%d9%8a%d9%85-masrhiat-el-zaem');
INSERT INTO `pm_videos` VALUES ('131', '166e21447', 'مسرحية العيال  كبرت -  masrhiat el ayal kebrat', '<p>لعيال كبرت هي مسرحية مصرية كوميدية مشهورة، إخراج سمير العصفوري تأليف : سمير خفاجي وبهجت قمر عرضت عام 1979 من بطولة:<br /> سعيد صالح (سلطان) الإبن الأكبر وفاشل دراسياً .<br /> أحمد زكي (كمال) الإبن المتفوق في دراسته الجامعية .<br /> يونس شلبي (عاطف) الإبن البليد والسمين , يعيش قصة حب مزعومة مع سعاد حسني .<br /> نادية شكري (سحر) الإبنة التي تحلم بالشهرة والمال عن طريق الرقص .<br /> حسن مصطفى (الأب رمضان السكري) يسعى للزواج من شابه وترك المنزل .<br /> كريمة مختار (الأم زينب جاد الله) شديدة الطيبة لحد السذاجة وكل اهتمامها بتدابير المنزل <br /> يكتشف &laquo;كمال&raquo; عن طريق الصدفة رسالة غرامية في حقيبة والده &laquo;رمضان السكري&raquo; يعلم فيها عن نيته الزواج بامرأة أخرى غير والدته فيقرر هو وأخوته الاجتماع للبحث في الأسباب التي دعت والدهم إلى ذلك والتخلص منهم.<br /> يعملون جهدهم لإقناع والدهم بالعدول عن هذه الفكرة بطرق ظريفة ومسلية منها محاولة إظهار أن عاطف تم اختطافه حتى لا يترك والدهم البيت. وفي إطار ذلك يتخلص كل منهم من العيوب التي يظن أنها السبب في هجر والدهم البيت.<br /> رمضان السكرى : يرجع عن فكرته بترك الأسرة والزواج بأخرى ويبقى مع عائلته.<br /> زينب تبدأ بالاهتمام أكثر بزوجها رمضان.<br /> سحر : كانت تفكر في العمل بالرقص الشرقي واللهو مع الزبائن فنبذت الفكرة، واقتربت أكثر من والدها.<br /> كمال: كان يفكر في الارتباط بامرأة تكبره في السن ولديها أطفال، فنبذ الفكرة وقرر الزواج بالفتاة التي رشحها له والده.<br /> سلطان : يقرر أن يترك حياة اللهو والتسكع والرسوب وأن يتفرغ للحصول على شهادته وأن يأخذ الحياة أكثر جدية.<br /> عاطف : الطفل الأصغر يبدأ في التركيز على دراسته وينبذ حبه للممثلة سعاد حسني.</p>', 'jjDxSq9-Qd8', '13832', '//i.ytimg.com/vi/jjDxSq9-Qd8/mqdefault.jpg', '0', '30', '1', 'admin', '1468862258', '1468691206', '1', 'https://www.youtube.com/watch?v=jjDxSq9-Qd8', '3', '1', '0', '1469413506', '1', '0', '0', '1', '1', '%d9%85%d8%b3%d8%b1%d8%ad%d9%8a%d8%a9-%d8%a7%d9%84%d8%b9%d9%8a%d8%a7%d9%84-%d9%83%d8%a8%d8%b1%d8%aa-masrhiat-el-ayal-kebrat');
INSERT INTO `pm_videos` VALUES ('132', '687607e5e', 'مسرحية عش المجانين شفيق يا راجل', '<p>مسرحية عش المجانين شفيق يا راجل<br /> يرغب شريف (محمد نجم) أن يتزوج من أماني (ليلى علوي)، و لكن والدها جاد الحق متولى عويس شبرا (حسن عابدين) يشترط أن تتزوج شقيقتها تهاني أولًا لأنها إختها الكبيرة، فتتفق أماني مع شريف على أن يقوم بالتنكر وعمل دور شخص قادم لخطبة إختها حتى يستطيعان إكمال زواجهما.<br /> طاقم العمل<br /> <br /> محمد نجم<br /> (شريف\\لطيف\\شلبى)<br /> <br /> ليلى علوي<br /> (أماني جاد الحق مت...)<br /> <br /> ميمي جمال<br /> (تهانى جاد الحق مت...)<br /> <br /> مظهر أبو النجا<br /> (الطبيب النفسى)<br /> <br /> حسن عابدين<br /> (جاد الحق متولي عو...)<br /> <br /> أديب الطرابلسي<br /> <br /> ناهد حسين<br /> <br /> محمد الإدنداني</p>', 'X0O4OZw4ojI', '12299', '//i.ytimg.com/vi/X0O4OZw4ojI/mqdefault.jpg', '0', '30', '1', 'admin', '1469013653', '1468691243', '3', 'https://www.youtube.com/watch?v=X0O4OZw4ojI', '3', '1', '0', '1469409905', '1', '0', '0', '1', '1', '%d9%85%d8%b3%d8%b1%d8%ad%d9%8a%d8%a9-%d8%b9%d8%b4-%d8%a7%d9%84%d9%85%d8%ac%d8%a7%d9%86%d9%8a%d9%86-%d8%b4%d9%81%d9%8a%d9%82-%d9%8a%d8%a7-%d8%b1%d8%a7%d8%ac%d9%84');
INSERT INTO `pm_videos` VALUES ('133', '99c7999c8', 'مسرحيه على بيه مظهر', '<p>مسرحية على بيه مظهر 1976<br /> تمثيل:<br /> <br /> محمد صبحي<br /> على بيه مظهر<br /> <br /> عزة كمال<br /> <br /> محسن محيي الدين<br /> <br /> عبدالحفيظ التطاوى<br /> <br /> مرسي الحطاب<br /> <br /> إنعام سالوسة<br /> <br /> محمود القلعاوي<br /> <br /> هدى زكي<br /> تأليف<br /> <br /> لينين الرملي<br /> مؤلف<br /> إخراج: أضف جديد<br /> <br /> أحمد بدر الدين</p>', 'Nu5_7xEPTfY', '11769', '//i.ytimg.com/vi/Nu5_7xEPTfY/mqdefault.jpg', '0', '30', '1', 'admin', '1469322401', '1468691323', '2', 'https://www.youtube.com/watch?v=Nu5_7xEPTfY', '3', '1', '0', '1469409905', '1', '0', '0', '1', '1', '%d9%85%d8%b3%d8%b1%d8%ad%d9%8a%d9%87-%d8%b9%d9%84%d9%89-%d8%a8%d9%8a%d9%87-%d9%85%d8%b8%d9%87%d8%b1');
INSERT INTO `pm_videos` VALUES ('134', '6ff618605', 'مسرحية الابندا -  masrahiat Alabhanda', '<p>هى مسرحية كوميدية اتصورت للتليفزيون 1998 و كانت اخر عمل يجمع بين علاء ولى الدين و محمد هنيدى. وكان اخر عمل ظهرت فيه منى عبد الغنى قبل ما تلبس الحجاب.<br /> المسرحية بطولة علاء ولي الدين ومحمد هنيدي و دينا ومنى عبد الغني و هانى رمزى و شريف منير و احمد السقا واحمد عيد وماجدة زكي واحمد عقل.</p>', 'eRXWP3dVmWw', '9686', '//i.ytimg.com/vi/eRXWP3dVmWw/mqdefault.jpg', '0', '30', '1', 'admin', '1468922595', '1468691991', '4', 'https://www.youtube.com/watch?v=eRXWP3dVmWw', '3', '1', '0', '1469409905', '1', '0', '0', '1', '1', '%d9%85%d8%b3%d8%b1%d8%ad%d9%8a%d8%a9-%d8%a7%d9%84%d8%a7%d8%a8%d9%86%d8%af%d8%a7-masrahiat-alabhanda');
